    [TestClass]
    public class TestAbsoluteFilepath
    {
        [TestMethod]
        public void TestLengthLongestPath()
        {
            int answer = LongestAbsoluteFilepath.LengthLongestPath("dir\n\tsubdir1\n\tsubdir2\n\t\tfile.ext");
            Assert.IsTrue(answer == 20);

            int answer2 = LongestAbsoluteFilepath.LengthLongestPath("dir\n\tsubdir1\n\t\tfile1.ext\n\t\tsubsubdir1\n\tsubdir2\n\t\tsubsubdir2\n\t\t\tfile2.ext");
            Assert.IsTrue(answer2 == 32);

            int answer3 = LongestAbsoluteFilepath.LengthLongestPath("a");
            Assert.IsTrue(answer3 == 0);

            int answer4 = LongestAbsoluteFilepath.LengthLongestPath("dir\n\tsubdir1\n\tsubdir2\n\t\tfile.ext");
            Assert.IsTrue(answer4 == 20);

            int answer5 = LongestAbsoluteFilepath.LengthLongestPath("dir\n    file.txt");
            Assert.IsTrue(answer5 == 12);

            int answer6 = LongestAbsoluteFilepath.LengthLongestPath("dir\n        file.txt");
            Assert.IsTrue(answer6 == 16);

            int answer7 = LongestAbsoluteFilepath.LengthLongestPath("a\n\tb1\n\t\tf1.txt\n\taaaaa\n\t\tf2.txt");
            Assert.IsTrue(answer7 == 14);

            int answer8 = LongestAbsoluteFilepath.LengthLongestPath("a\n\taa\n\t\taaa\n\t\t\tfile1.txt\naaaaaaaaaaaaaaaaaaaaa\n\tsth.png");
            Assert.IsTrue(answer8 == 29);
        }
    }

