        private void RunLfuCacheTests(LFUCache cache, string[] operations, List<int[]> arguments, string[] answers)
        {
            int testCase = 0;
            foreach(string op in operations)
            {
                int[] args = arguments[testCase];
                if (op == "put")
                {
                    cache.Put(args[0], args[1]);
                }
                else
                {
                    string ans = answers[testCase];
                    int value;
                    int.TryParse(ans, out value);
                    int response = cache.Get(args[0]);
                    Assert.IsTrue(response == value);
                }

                testCase += 1;
            }
        }
    }
